import React from 'react';

export default function Main() {
  return (
    <>
    <div className='container' style={{display:"flex",justifyContent:"center",alignItems:"center",marginTop:"150px"}}>
        <div style={{height:"250px",width:"300px",border:"4px solid #EAEAEA",borderRadius:"50%",}}><img src="camera.jpg" alt="error" height="250px" width="300px" style={{borderRadius:"50%"}}  ></img></div>
    </div>
    </>
  )
}
